import styled from 'styled-components'


export const MovieContainer = styled.div`

   color:  #000;
   background: #f9f9f9;
   @media screen and (max-width: 768px){
    padding: 100px 0;
}
`

export const MovieWrapper = styled.div`
   display: grid;
   z-index: 1;
   height: 860px;
   width: 100%;
   max-width: 1100px;
`
